INSERT INTO `xry_comment` VALUES ('1', '6c892c5ae931401b9c535254653000ee', '6c892c5ae931401b9c535254653000ee', '2', '1', '1', '为建立健全全省公平、统一、规范的城乡居民基本养老保险（以下简称城乡居民养老保险）制度，根据《中华人民共和国社会保险法》和《国务院关于建立统一的城乡居民基本养老保险制度的意见》（国发[2014]8号），结合我省实际，制定本实施办法。本实施办法自2014年6月1日起施行，已有规定与本实施办法不一致的，按照本实施办法规定执行。', '2018-12-03 15:58:47');
INSERT INTO `xry_comment` VALUES ('2', '13', 'cea64dd4b26344858fda2d1c17a52cc4', '4', '0', '0', '参加养老保险后，云南村民最关注的莫过于养老金领取的标准了。据了解，云南省农村养老保险领取标准是由基础养老金和个人账户养老金构成的，其中基础养老金最低标准是75元，具体可根据当地制定的标准执行。', '2018-12-04 13:48:43');
INSERT INTO `xry_comment` VALUES ('3', '14', 'e9fe8647d1d14c258223c39c9e74c380', '6', '0', '1', '云南省养老保险待遇中有一项是个人账户养老金，而居民想要了解详细的账户信息，就需要查询账户，那云南省农村养老保险查询方法有哪些？常见的方法有三种，即网上查询、电话查询、窗口查询，建议市民选择网上查询，非常方便。', '2018-12-04 13:53:03');
